import React from "react";
import { styled } from "styled-components";

const CryptoWrapper = styled.div`
  width: 100%;
  height: 80px;

  img {
    width: 40px;
  }
`;

function Crypto({ fullName, price, ticker, change, logo }) {
  return (
    <CryptoWrapper>
      <div className="">
        <img src={logo} alt="" />
      </div>
      <div className="">
        {fullName} : {ticker}
      </div>
      {price} : {change} :
    </CryptoWrapper>
  );
}

export default Crypto;
